function generateStops() {
    allOptions = "";
    for (var key in stationCodes) {
        var bfiveName = stationCodes[key];
        if (isNaN(key.charAt(key.length - 1))) {
            key = key.slice(0, -1); 
        };
        var line = key.slice(0, -2);
        if (lineHold !== line) {
            lineHold = line;
        };
        allOptions += (generateStopsOptions(lineHold, key, bfiveName));
    }
    return allOptions;
}

function generateStopsOptions(lineName, stopNum, stopName) {
    //<option class="o" value="O16">O16 </option>
    return '<option class="' + lineName + '" value="' + stopNum + '">' + stopNum + ' ' + stopName + '</option>'
}

function calcFares(cid) { //return the number of trips for that row
    generateStops();
    rowNum = cid.slice(-1);
    var sloc = document.getElementById("startUser" + rowNum).value;
    var eloc = document.getElementById("endUser" + rowNum).value;
    var freq = document.getElementById("freqUser" + rowNum).value;
    var round = document.getElementById("roundUser" + rowNum).checked;
    var farePer; //store the fare price per trip from allfares 2d array
    sind = allstops.indexOf(sloc);
    eind = allstops.indexOf(eloc);
    if ((sind === -1) | (eind === -1)) {
        alert("" + rowNum + "");
        return -1;
    };
    farePer = allfares[sind][eind]; 
    var factor = 1;
    if ((sloc === eloc) | (farePer === 0)) {
        alert("" + rowNum + "0");
        document.getElementById("farePerRound" + rowNum).innerHTML = "$ " + farePer;
        document.getElementById("itemCost" + rowNum).innerHTML = "$ " + (farePer * factor);
        return 0;
    };
    document.getElementById("farePerRound" + rowNum).innerHTML = "$ " + farePer;
    if (freq[1] == "w") {
        factor = 4;
    }; 
    if (round == true) {
        factor *= 2;
    };
    factor *= freq[0];
    document.getElementById("itemCost" + rowNum).innerHTML = "$ " + (farePer * factor);
    return factor;
}

function calcTotal() {
    var i; //counter
    var tfare = 0;
    var tfactor = 0;
    var savings = 0;
    for (i = 1; i < curRow; i++) {
        var idtoCall = "calcFares" + i;
        eachFactor = calcFares(idtoCall);
        if (eachFactor === -1) {
            alert("");
            document.getElementById("trips").innerHTML = "";
            document.getElementById("ovlCost").innerHTML = "";
            document.getElementById("msg").innerHTML = "1280";
            return;
        };
        tfactor += eachFactor;
        itemVal = document.getElementById("itemCost" + i).innerHTML.slice(2)
        if (itemVal === "") { //when starting and ending stations are the same
            itemVal = 0;
        };
        tfare += parseInt(itemVal);        
    }
    document.getElementById("trips").innerHTML = " " + tfactor;
    discountFactor = applyDiscount(tfactor);
    if (discountFactor === 0) {
        document.getElementById("ovlCost").innerHTML = '<a href="https://www.metro.taipei/cp.aspx?n=AB56163F79ECB2C2" target="_blank"></a> $ ' + tfare;
    } else {
        savings = Math.round(tfare * discountFactor);
        tfare = Math.round(tfare * (1 - discountFactor));
        document.getElementById("ovlCost").innerHTML = ' $ ' + savings + '<a href="https://www.metro.taipei/cp.aspx?n=AB56163F79ECB2C2" target="_blank"></a> $ ' + tfare;
    }
    if (tfare >= 1180) {
        document.getElementById("msg").innerHTML = "1280";
    }
    else {
        document.getElementById("msg").innerHTML = "1280";
    }
}

function applyDiscount(numTrips) {
    var discount = 0;
    if (numTrips < 11) {
        return discount;
    } else if (numTrips < 21) {
        return discount = 0.1;
    } else if (numTrips < 31) {
        return discount = 0.15;
    } else if (numTrips < 41) {
        return discount = 0.2;
    } else if (numTrips < 51) {
        return discount = 0.25;
    } else {
        return discount = 0.3;
    };
}

function addTrip() {
    var table = document.getElementById("dt");
    var row = table.insertRow(curRow);
    var cell1 = row.insertCell(0);
    var cell2 = row.insertCell(1);
    var cell3 = row.insertCell(2);
    var cell4 = row.insertCell(3);
    var cell5 = row.insertCell(4);
    var cell6 = row.insertCell(5);
    var cell7 = row.insertCell(6);
    cell1.innerHTML = '<label for="startUser' + curRow + '"></label><select class="startUser" id="startUser' + curRow + '"><option value="" selected disabled hidden>  </option>' + allOptions;
    cell2.innerHTML = '<label for="endUser' + curRow + '"></label><select class="endUser" id="endUser' + curRow + '"><option value="" selected disabled hidden>  </option>' + allOptions;
    cell3.innerHTML = '<label for="freqUser' + curRow + '"></label><select class="freqUser" id="freqUser' + curRow + '"><option value="1m" class="monf">1</option><option value="2m" class="monf">2</option><option value="3m" class="monf">3</option><option value="4m" class="monf">4</option><option value="1w" class="weekf">1</option><option value="2w" class="weekf">2</option><option value="3w" class="weekf">3</option><option value="4w" class="weekf">4</option><option value="5w" class="weekf">5</option><option value="6w" class="weekf">6</option><option value="7w" class="weekf">7</option></select>';
    cell4.innerHTML = '<input type="checkbox" class="roundUser" id="roundUser' + curRow + '" value="Yes" /><label for="roundUser' + curRow + '"></label></div>';
    cell5.innerHTML = '<label for="calcUser' + curRow + '"><input type = "button" value = "" class="calcFares" id = "calcUser' + curRow + '" onclick = "calcFares(this.id)" /></label >';
    cell6.innerHTML = '<p id="farePerRound' + curRow + '"></p>';
    cell7.innerHTML = '<p id="itemCost' + curRow + '"></p>';
    curRow += 1;
}

function delTrip() {
    if (curRow > 1) {
        curRow -= 1;
        document.getElementById("dt").deleteRow(curRow);
	document.getElementById("trips").innerHTML = "";
        document.getElementById("ovlCost").innerHTML = "";
        document.getElementById("msg").innerHTML = "1280";
    }
}
